const Card = ({ results }) => {
        let display;

        if (results) {
                display = results.map((element) => {
                        let { id, image, name, status, location } = element;
                })
        }
        else {
                display = 'No Characters Found :/';
        }

        return <>{display}</>
}

export default Card;
